'use strict';

/**
* Weibull distributed pseudorandom numbers.
*
* @module @stdlib/math/base/random/weibull
*
* @example
* var weibull = require( '@stdlib/math/base/random/weibull' );
*
* var v = weibull( 2.0, 3.0 );
* // returns <number>
*
* @example
* var factory = require( '@stdlib/math/base/random/weibull' ).factory;
* var weibull = factory( 3.0, 2.0, {
* 	'seed': 297
* });
*
* var v = weibull();
* // returns ~1.932
*
* @example
* var factory = require( '@stdlib/math/base/random/weibull' ).factory;
* var weibull = factory({
* 	'seed': 297
* });
*
* var v = weibull( 3.0, 2.0 );
* // returns ~1.932
*/

// MODULES //

var setReadOnly = require( '@stdlib/utils/define-read-only-property' );
var weibull = require( './weibull.js' );
var factory = require( './factory.js' );


// METHODS //

setReadOnly( weibull, 'factory', factory );


// EXPORTS //

module.exports = weibull;
